Builder:
  fullname: Destroyer
  shortname: B
  description: Get paid $1 for every single block broken.
  ChatColour: WHITE
  chat-display: full
  max-level: 200
  leveling-progression-equation: 10*(joblevel)+(joblevel*joblevel*4)
  income-progression-equation: baseincome+(baseincome*(joblevel-1)*0.01)
  points-progression-equation: basepoints+(basepoints*(joblevel-1)*0.01)
  experience-progression-equation: baseexperience-(baseexperience*((numjobs-1) *0.01))
  rejoinCooldown: 10
  maxDailyQuests: 0
  Quests:
    '1':
      Name: Architect
      Objectives:
      - Place;spruce_planks;50
      - Place;birch_planks;50
      - Place;wool;50
      RewardCommands:
      - eco give [playerName] 100
      - msg [playerName] Completed quest!
      RewardDesc:
      - Place blocks and get money
      - Get 100 for this!
